
import { ADD_CONTACT, LOAD_START, LOAD_DONE, LOAD_CONTACTS_DONE, UPDATE_FILTER } from '../actions/contactActions'

const initialState = {
  contactList: [
    {
      id: 'steinar-c1112d14-1378-43a9-b617-179341378c0c',
      name: 'Steinar Snær Guðjónsson',
      phoneNumber: '8447760',
      photo: 'data:image/png;base64,'
    }
  ],
  filter: '',
  isLoading: false
}

const contactReducer = (state = initialState, action) => {
  switch (action.type) {
    case ADD_CONTACT: {
      const { id, name, phoneNumber, photo } = action.payload

      return {
        ...state,
        contactList: [
          ...state.contactList,
          {
            id: id,
            name: name,
            phoneNumber: phoneNumber,
            photo: photo
          }
        ]
      }
    }
    case LOAD_START:
      return {
        ...state,
        isLoading: true
      }
    case LOAD_CONTACTS_DONE:
      return {
        ...state,
        isLoading: false,
        contactList: action.payload.contacts,
        filter: ''
      }
    case LOAD_DONE:
      return {
        ...state,
        isLoading: false
      }
    case UPDATE_FILTER:
      return {
        ...state,
        filter: action.payload
      }
    default:
      return state
  }
}

export default contactReducer
